								// 			</Link>
								// 			<span>10 days ago</span>
								// 		</p>
								// 	</div>
								// 	<p className="overflow-hidden overflow-ellipse line-clamp-4 mt-2 text-white">
								// 		{/* {post.content} */}
								// 		Lorem ipsum dolor sit amet, consectetur adipiscing elit.
								// 		Proin facilisis libero sit amet lobortis pellentesque.
								// 		Integer congue eros sit amet malesuada ornare. Quisque
								// 		convallis suscipit tellus, ac feugiat nisi lobortis quis.
								// 		Vestibulum tempor justo id posuere aliquet. Nulla maximus
								// 		erat dolor, eget euismod dui mattis quis. Vivamus velit
								// 		enim, sollicitudin sit amet tellus vitae, pulvinar lacinia
								// 		arcu. Sed vel sapien in mi elementum lacinia. Suspendisse
								// 		molestie nisl a eros ultrices euismod. Donec eget faucibus
								// 		lacus, et pretium dui. Proin dui lacus, lacinia sed lacus
								// 		molestie, tempus mollis velit. Phasellus ut pretium libero.
								// 		Pellentesque laoreet dolor libero, sit amet accumsan neque
